function countOfCharInString(char,string){
  let charObj = {}

  string.forEach(char => {
    if(charObj[char] === undefined){
      charObj[char] = 1
    } else {
      charObj[char] = charObj[char] + 1
    }
  })

  return charObj[char]
}

export default countOfCharInString
